import React, { Component } from 'react';
import { GoogleApiWrapper } from 'google-maps-react';
import { FaUtensils } from 'react-icons/fa'; // Importing the food icon

class NearbyRestaurants extends Component {
  state = {
    bestRestaurants: [],
    currentPage: 1
  };

  componentDidMount() {
    // Get user's current location
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(this.searchNearbyRestaurants);
    } else {
      console.log("Geolocation is not supported by this browser.");
    }
  }

  searchNearbyRestaurants = (position) => {
    const { google } = this.props;
    const { latitude, longitude } = position.coords;

    // Create a PlacesService instance
    const placesService = new google.maps.places.PlacesService(document.createElement('div'));

    // Define search parameters
    const request = {
      location: new google.maps.LatLng(latitude, longitude),
      radius: 500, // Search radius in meters (adjust as needed)
      type: 'restaurant',
      rankBy: google.maps.places.RankBy.PROMINENCE // Sort by prominence
    };

    // Perform nearby search
    placesService.nearbySearch(request, (results, status) => {
      if (status === google.maps.places.PlacesServiceStatus.OK) {
        // Filter restaurants with 4+ stars and 50+ reviews
        const filteredRestaurants = results.filter(restaurant => {
          return restaurant.rating >= 4 && restaurant.user_ratings_total >= 50;
        });

        // Update state with the filtered restaurants
        this.setState({ bestRestaurants: filteredRestaurants });
      } else {
        console.error('Error fetching nearby restaurants:', status);
      }
    });
  }

  loadNextRestaurants = () => {
    const { google } = this.props;
    const { latitude, longitude } = this.state.bestRestaurants[0].geometry.location;

    // Create a PlacesService instance
    const placesService = new google.maps.places.PlacesService(document.createElement('div'));

    // Define search parameters for the next page
    const request = {
      location: new google.maps.LatLng(latitude, longitude),
      radius: 500, // Search radius in meters (adjust as needed)
      type: 'restaurant',
      rankBy: google.maps.places.RankBy.PROMINENCE, // Sort by prominence
      pageToken: this.state.nextPageToken // Use the next page token to fetch the next page of results
    };

    // Perform nearby search for the next page
    placesService.nearbySearch(request, (results, status, pagination) => {
      if (status === google.maps.places.PlacesServiceStatus.OK) {
        // Filter restaurants with 4+ stars and 50+ reviews
        const filteredRestaurants = results.filter(restaurant => {
          return restaurant.rating >= 4 && restaurant.user_ratings_total >= 50;
        });

        // Update state with the next page of restaurants
        this.setState(prevState => ({
          bestRestaurants: [...prevState.bestRestaurants, ...filteredRestaurants],
          nextPageToken: pagination.hasNextPage ? pagination.nextPageToken : null
        }));
      } else {
        console.error('Error fetching nearby restaurants:', status);
      }
    });
  }

  render() {
    const { bestRestaurants } = this.state;

    return (
      <div>
        <h2>Top Nearby Restaurants with 4+ Stars and 50+ Reviews</h2>
        <div style={{ display: 'flex', flexWrap: 'wrap' }}>
          {bestRestaurants.map((restaurant, index) => (
            <div key={index} style={{ margin: '10px', textAlign: 'center', width: '200px' }}>
              <div>
                {restaurant.photos && restaurant.photos.length > 0 && (
                  <>
                    <img src={restaurant.photos[0].getUrl()} alt={restaurant.name} style={{ width: '100%', height: 'auto', marginBottom: '5px' }} />
                    {restaurant.photos.length > 1 && (
                      <img src={restaurant.photos[1].getUrl()} alt={restaurant.name} style={{ width: '100%', height: 'auto', marginBottom: '5px' }} />
                    )}
                  </>
                )}
              </div>
              <p style={{ fontWeight: 'bold' }}>{restaurant.name}</p>
              <p>{restaurant.rating} stars ({restaurant.user_ratings_total} reviews)</p>
            </div>
          ))}
        </div>
        {this.state.nextPageToken && (
          <button onClick={this.loadNextRestaurants} style={{ marginTop: '20px', padding: '10px', backgroundColor: '#ff5722', color: 'white', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
            <FaUtensils style={{ marginRight: '5px' }} />
            Hit me up for more restaurants!
          </button>
        )}
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCnv1eojLjZwtHpBXy_QZ3bSv2slXEsLyc'
})(NearbyRestaurants);
